import React from 'react';

const Header = () => {

    return (
        <header className="header">

            <div className="header--logo-container">
                <img src="../images/logo192.png" alt="logo Jara Amaro psicóloga"></img>
            </div>
            <h1>Jara Amaro psicóloga</h1>

        </header>
    );
};

export default Header;
